import Aside from "layout/Aside";
import FlexRow from "layout/FlexRow";
import GeneratorSettings from "features/settings/GeneratorSettings";
import ToggleButton from "components/ToggleButton";

export default function Home() {
    return (
        <div id="home">
            <FlexRow>
                <h1>Home</h1>
                <ToggleButton />
                <Aside>
                    <GeneratorSettings />
                </Aside>
            </FlexRow>
        </div>
    );
}
